import React, {Component} from 'react';
import {Button, Form} from "react-bootstrap";
import axios from 'axios';

class DokumentyCud extends Component {
    constructor(props) {
        super(props);
        this.state = {
            doks : [],
            doki : [],
            dok :{}
        };
    }
    componentDidMount() {
        axios({
            method: 'get',
            url: `http://localhost:8081/dok/${this.props.id}`,
        }).then((response) => {
            this.setState({dok: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
        axios({
            method: 'get',
            url: `http://localhost:8081/doki/all`,
        }).then((response) => {
            this.setState({d: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });

        axios({
            method: 'get',
            url: `http://localhost:8081/stanmag/all`,
        }).then((response) => {
            this.setState({stan: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
    }
    render() {
        return (
            <div>
                {this.props.typ}
            </div>
        );
    }
}

export default DokumentyCud;
